import React,{useState} from 'react';

function Form(){
    const [name ,setName]= useState({Id:"",UserId:"",Title:"",Body:""})

    return (
        <>
        <form>
        <input type='number'
         placeholder='enter id'
         value={name.Id}
         onChange={e=>setName({Id:e.target.value})}
         /><br/>
        <input type='text' placeholder='enter user-id' ></input><br></br>
        <input type='text' placeholder='enter title' ></input><br></br>
        <input type='text' placeholder='enter body' ></input><br></br>
       <a href='/'>submit</a>
       </form>
       </>    
)
}
export default Form;
